// Declarando as rotas para renderizar os item de acordo com a rota
const routes = [
  {
    header: [
      {
        name: "Home",
        path: "/",
      },
      {
        name: "News",
        path: "/news",
      },
      {
        name: "Settings",
        path: "/settings",
      },
    ],
    sidebar: [
      {
        name: "Home",
        path: "/",
      },
      {
        name: "News",
        path: "/news",
      },
      {
        name: "Settings",
        path: "/settings",
      },
    ],
  },
];

export { routes };
